import React from 'react';
import NavbarTop from './NavbarTop';
import '../App.css';

function Dashboard() {
	return (
		<header>
			<NavbarTop />
			<h2>Dashboard</h2>
		</header>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonsElement: {
		borderRadius: '50%',
		background: '#dae1e7ff'
	}
};
export default Dashboard;
